import React from 'react';
import './MemberCard.css';

function MemberCard({ member }) {
  return (
    <div className="member-card">
      <img src={member.profilePic} alt={member.name} />
      <h3>{member.name}</h3>
      <p>{member.role}</p>
      <button>Visit Profile</button>
    </div>
  );
}

export default MemberCard;
